import { BrowserModule } from "@angular/platform-browser";
import { NgModule } from "@angular/core";
import { FormsModule } from "@angular/forms";
import { AppComponent } from "./app.component";
import { StoreModule } from "@ngrx/store";
import { counterReducer } from "./my-counter/store/counter.reducer";
import { MyCounterComponent } from "./my-counter/my-counter.component";
import { IncrementComponent } from "./increment/increment.component";
import { DecrementComponent } from "./decrement/decrement.component";
import { ResetComponent } from "./reset/reset.component";
import { InputComponent } from "./input/input.component";
import { CustomCounterInputComponent } from "./my-counter/custom-counter-input/custom-counter-input.component";
import { HomeComponent } from "./home/home.component";
import { AppRoutingModule } from "./app-routing-module";
import { HeaderComponent } from "./shared/component/header/header.component";
import { PostsListComponent } from "./posts/posts-list/posts-list.component";
import { appReducer } from "./store/app.state";

@NgModule({
  declarations: [
    AppComponent,
    MyCounterComponent,
    IncrementComponent,
    DecrementComponent,
    ResetComponent,
    InputComponent,
    CustomCounterInputComponent,
    HomeComponent,
    HeaderComponent,
    PostsListComponent,
  ],
  imports: [
    BrowserModule,
    FormsModule,
    AppRoutingModule,
    StoreModule.forRoot(appReducer),
  ],
  providers: [],
  bootstrap: [AppComponent],
})
export class AppModule {}

